// Convert each MeasureReport in the Bundle into CSV format
for (var i = 0; i < msg['entry'].length; i++){
	var bundleEntry = msg['entry'][i];
	var measureReport = bundleEntry['resource'];
	var dataRow = cdcMeasureReportToCSV(measureReport);
	tmp.appendChild(dataRow);
}

