/**
	Returns an HTML table displaying the CSV data

	@param {Object} csvRow - A CSV row
	@param {Object} headerRows - An optional list of CSV rows containing the header rows of the table
	@return {String} return HTML table representing the CSV arguments
*/
function createTableFromCsvRow(csvRow, headerRows) {
	var html = '<table>';

	if (headerRows != null) {
		for (var i = 0; i < headerRows.length; i++) {
			var headerRow = headerRows[i];
			html += '<tr>';
			for (var j = 0; j < headerRow.children().length(); j++) {
				html += '<th>' + headerRow.children()[j] + '</th>';
			}
			html += '</tr>';
		}
	}

	if (csvRow != null) {
		html += '<tr>';
		for (var i = 0; i < csvRow.children().length(); i++) {
			html += '<td>' + csvRow.children()[i] + '</td>';
		}
		html += '</tr>';
	}

	html += '</table>';
	return html;
}

/**
	Get SANER measure group code from MeasureReport_Group.

	@param {Object} group - MeasureReport_Group JSON object
	@return {String} return SANER measure group code or null
*/
function getGroupCode(group) {
	for (var i = 0; i < group['code']['coding'].length; i++) {
		var coding = group['code']['coding'][i];

		// The examples use either of these systems for groups
		if (coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/MeasureGroupSystem'
			|| coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/PopulationSystem') {
			return coding['code'];
		}
	}
	return null;
}

/**
	Get SANER population code from MeasureReport_Population.

	@param {Object} population - MeasureReport_Population JSON object
	@return {String} return SANER population code or null
*/
function getPopulationCode(population) {
	for (var i = 0; i < population['code']['coding'].length; i++) {
		var coding = population['code']['coding'][i];

		// The examples use either of these systems for their population measures
		if (coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/MeasurePopulationSystem'
			|| coding['system'] === 'http://hl7.org/fhir/us/saner/CodeSystem/PopulationSystem') {
			return coding['code'];
		}
	}
	return null;
}

/**
	Returns the value or '' if null.

	@param {String} value - A string value
	@return {String} return the value or '' if null
*/
function getValueOrEmpty(value) {
	if (value == null) {
		return '';
	}
	return value;
}

/**
	Takes a FHIR MeasureReport resource and converts it into a CDC CSV.

	@param {Object} measureReport - FHIR MeasureReport in JSON
	@return {Object} return new Row
*/
function cdcMeasureReportToCSV(measureReport) {
	var columns = ["collectionDate","numTotBeds","numbeds","numBedsOcc","numICUBeds","numNICUBeds","numICUBedsOcc","numNICUBedsOcc","numVent","numVentUse","numC19HospPats",
	"numConfC19HospPats","numC19MechVentPats","numConfC19MechVentPats","numC19HOPats","numConfC19HOPats","numC19OverflowPats","numConfC19OverflowPats","numC19OFMechVentPats",
	"numConfC19OFMechVentPats","numC19Died","numc19confnewadm","numc19suspnewadm","numc19honewpats","numConfC19HONewPats","numc19prevdied","numConfC19PrevDied","numC19ICUPats",
	"numConfC19ICUPats"];

	// generate a new empty row
	var row = <row/>;
	for (var c=0; c<columns.length; c++) {
		row[columns[c]] = "";
	}

	for (var i=0; i<measureReport['group'].length; i++) {
		var group = measureReport['group'][i];
		var groupCode = getGroupCode(group);
		if (groupCode === 'Beds') {
			mapBedsMeasures(group, row);
		} else if (groupCode === 'Ventilators') {
			mapVentilatorsMeasures(group, row);
		} else if (groupCode === 'Encounters') {
			mapEncountersMeasures(group, row);
		}
	}
	if (measureReport['period'] != null && measureReport['period']['end'] != null) {
		row['collectionDate'] = convertDate(measureReport['period']['end'], 'MM/dd/yyyy');
	}
	return row;
}

function mapBedsMeasures(group, row) {
	if (group['population'] != null) {
		for (var i = 0; i < group['population'].length; i++) {
			var population = group['population'][i];
			var measureCode = getPopulationCode(population);
			if (measureCode === 'numTotBeds') {
				row['numTotBeds'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numbeds') {
				row['numbeds'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numBedsOcc') {
				row['numBedsOcc'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numICUBeds') {
				row['numICUBeds'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numNICUBeds') {
				row['numNICUBeds'] = getValueOrEmpty(population['count'])
			} else if (measureCode === 'numICUBedsOcc') {
				row['numICUBedsOcc'] = getValueOrEmpty(population['count']);
			} else if (measureCode === 'numNICUBedsOcc') {
				row['numNICUBedsOcc'] = getValueOrEmpty(population['count']);
			}
		}
	}
}

