		} else if (measureCode === 'totalTestResultsIncrease') {
			row['newTestsResulted'] = getValueOrEmpty(population['count']);
			totalTestResultsIncrease = parseInt(row['newTestsResulted']);
		} else if (measureCode === 'positiveIncrease') {
			row['newPositiveCovid19Tests'] = getValueOrEmpty(population['count']);
			positiveIncrease = parseInt(row['newPositiveCovid19Tests']);
		}
	}

	// TODO - check calculations
