/**
	Deletes null value "count" nodes in MeasureReport.group[i].population[j] nodes and adds a "_count" node to them that indicates the data is absent.
	Modifies the JSON object passed in.

	@param {Object} measureReport - The MeasureReport JSON object
*/
function replaceNullCounts(measureReport) {
	if (measureReport['group'] != null) {
	for (var i=0; i<measureReport['group'].length; i++) {
		var group = measureReport['group'][i];
		if (group['population'] != null) {
			for (var p=0; p<group['population'].length; p++) {
				var population = group['population'][p];
				var count = population['count'];
				if (count == null || isNaN(count)) {
					// remove child count
					delete population['count'];

					population['_count'] = {
  										"extension": [
										    {
										      "url": "http://hl7.org/fhir/StructureDefinition/data-absent-reason",
										      "valueCode": "unsupported"
										    }
										  ]
										};

				}
			}
		}
	}
}
